Hey habe mir heute Item Sets gemacht, zuerst hat alles funktioniert, habe dann gespielt und gemerkt das mir Control Ward noch fehlt und es danach hinzugef&uuml;gt. Habe dieses Control Ward zu &quot;Consumables&quot; hinzugef&uuml;gt und trotzdem hat es sich nach jedem Block immer einzeln reingesetzt. Habe daraufhin wieder alles gel&ouml;scht (war viel Arbeit) und neu gemacht. Diesmal keinen einzigen Block &quot;Consumables&quot; genannt und gespeichert. Trozdem ist noch immer dieses Control Ward unter &quot;Consumables&quot; im neuen Item Set mit dabei! Wie kann ich diesen Bug fixen? Es nervt extrem! In dem ItemsSets.json file ist auch kein Anzeichen von dem Block und dem Ward zu finden.

Außerdem sehe ich in meinem Foren Profil noch immer keinen einzigen Eintrag von mir obwohl ich hier schon viel geschrieben habe..

